import React from 'react';
import { Link } from 'react-router-dom';

const Login = () => {
    return (<>
        <section>
            <div className="login-holder">
                <div className="login">
                    <h4>Log in to Coursely</h4><a className="google-btn btn" href="#"><i className="fa-brands fa-google me-2"></i>Continue with Google</a>
                    <div><input type="text" placeholder="Email" /></div>
                    <div><input type="password" placeholder="password" /></div><a className="btn my-btn" href="#">Login</a>
                    <div><span>Don't have an Account?&nbsp;<strong>Sign up</strong></span></div>
                </div>
            </div>
        </section>
    </>);
}

export default Login;
